import React from 'react'

function Card(props){
    return <div className='Card'>{affichage ? props.symbol : '-'}</div>
}

function setSymbol(props, symbol){
    props.symbol = symbol
}

function turnCard(props){
    props.affichage = !props.affichage
}



export default Card;
